  DECLARE qr_caducidad TIME;
 
  SELECT caducidad INTO qr_caducidad
  FROM codigoqr
  WHERE id_Codigo = NEW.id_Codigo;
  
  IF NEW.horaEntrada > qr_caducidad THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El codigoQR ha caducado';
  END IF;
END
$$
