DELIMITER $$
CREATE TRIGGER `verificar_hora_entrada` BEFORE INSERT ON `entradas` FOR EACH ROW BEGIN
    DECLARE junta_horaInicio TIME;

    -- Obtener la hora de inicio de la junta correspondiente al codigoqr
    SELECT horaInicio INTO junta_horaInicio
    FROM codigoqr
    WHERE id_Codigo = NEW.id_Codigo;

