    IF NEW.horaEntrada < junta_horaInicio THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No se puede registrar una entrada antes de la hora de inicio de la junta';
    END IF;
END
$$
DELIMITER ;

